import axios from "axios"

const FLIGHT_API_BASE_URL = "http://localhost:8090/api/v1/flights/departure-flight"

class FlightServices {

    getDepartureFlight() {
        return axios.get(FLIGHT_API_BASE_URL);
    }
}


export default new FlightServices()
